script: |
  super -f text -I q8443.spq | sort > q8443.out

inputs:
  - name: q8443.spq
    data: |
      SELECT DISTINCT - cor1.col0 FROM tab2 (FORMAT parquet), tab1 (FORMAT parquet) AS cor0, tab0 (FORMAT parquet), tab1 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab1
  - name: tab2

outputs:
  - name: q8443.out
    data: |
      -3
      -64
      -80
